style.css:
@-moz-document url("http://www.tumblr.com") , url("https://www.tumblr.com") {
body {
	background-image: url('http://24.media.tumblr.com/774f3413cca31e71d998ff401b1bf518/tumblr_mnlghtSJke1qb2yato7_1280.jpg')

}

#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {
	background:#ffd6fe;
}


.post {
	background-color:#d6edff;
	border-radius: 1px;
}


.post:hover {

	background-color:#fde9fd;
	border-radius: 5px;
}

.post_content{
	background: transparent !important;
}


#right_column:after {
	background: none !important;
}


.controls_section li {
	background: #c8dae9;
}
}
